import React from "react";
import { Link } from "react-router-dom";
// import { useState } from "react";
const HomePage = () => {
  // const [isOpen, setIsOpen] = useState(false);
  // const toggleMenu = () => {
  //   setIsOpen(!isOpen);
  // };
  return (
    <div>
      <header className="">
        <div className=" bg-sand container py-[28px] flex justify-between lg:flex-row md:flex-col sm:flex-col xs:flex-col items-center">
          <div className="flex gap-[46px] w-full max-w-[529px] mr-[38px]  xs:gap-3 ">
            <div className="flex justify-between w-full my-[13.5px] xs:ml-7">
              {/* <Link to="aa"> */}
              <button>
                <img
                  className="cursor-pointer h-[32px] sm:hidden "
                  src="images/hamburgermenu.png"
                  alt=""
                />
              </button>
              {/*  */}
              <div
                className={`lg:flex lg:items-center lg:w-auto w-full lg:static absolute bg-gray-800 lg:bg-transparent transition-all duration-300 ease-in-out ${
                  isOpen ? "top-14" : "-top-48"
                }`}>
                <ul className="lg:flex lg:space-x-6 p-4 lg:p-0 text-white">
                  <li className="hover:bg-gray-700 px-3 py-2 rounded">
                    <Link href="#">Home</Link>
                  </li>
                  <li className="hover:bg-gray-700 px-3 py-2 rounded">
                    <Link href="#">About</Link>
                  </li>
                  <li className="hover:bg-gray-700 px-3 py-2 rounded">
                    <Link href="#">Services</Link>
                  </li>
                  <li className="hover:bg-gray-700 px-3 py-2 rounded">
                    <Link href="#">Contact</Link>
                  </li>
                </ul>
              </div>
              {/*  */}
              {/* </Link> */}
              <img className="min-w-[115px]" src="images/logo.png" alt="" />
              <img
                className="cursor-pointer h-[32px] sm:hidden "
                src="images/search.png"
                alt=""
              />
            </div>
            <div className="blue  font-bold  flex items-center w-full min-w-[366px]  justify-between xs:hidden">
              <div>Home</div>
              <div>Category</div>
              <div>About</div>
              <div>Contact</div>
            </div>
          </div>
          <div className="flex xs:hidden">
            <input
              type="text"
              placeholder="search something here!"
              className="w-full min-w-[280px] rounded-[46px]  text-center sm:h-[48px] sm:m-5 xs:h-[48px] xs:m-5 "
            />
            {/* <img className="position" src="images/search.png" alt="" /> */}
            <div className="flex">
              <div
                className="bg-blue w-[280px] rounded-[46px]  text-center flex items-center justify-center

                 sm:m-5 xs:h-[48px] xs:m-5 ">
                Join the community
              </div>
              <select className="bg-sand">
                <option value="">one</option>
                <option value="">two</option>
                <option value="">three</option>
                <option value="">four</option>
              </select>
            </div>
          </div>
        </div>
      </header>
    </div>
  );
};

export default HomePage;
